import React, { Component } from 'react';

import SHOP_DATA from './ShopData';

class Shop extends Component {
    constructor(props) {
        super(props);
        this.state = {
            collections: SHOP_DATA
        }
    }
    render() {
        return (
            <div>
                SHOP_DATA
            </div>
        );
    }
}

export default Shop;
